import React from 'react'
import { Box, AppBar, Toolbar, Avatar, Typography } from "@mui/material"


export const NavBar = () => {
    return (
        <Box>
            <AppBar position="static">
                <Toolbar>
                    <Box
                    display={'flex'}
                    sx={{
                        alignItems: 'center'
                    }}
                    >
                        <Avatar alt="William Ho" src={`${process.env.PUBLIC_URL}/selfimage.jpg`} />
                        <Typography>WILLIAM HO</Typography>
                    </Box>



                </Toolbar>
            </AppBar>
        </Box>
    )
}
